fn setup_cbindgen() { let crate_dir = env::var("CARGO_MANIFEST_DIR"); match crate_dir { Ok(val) => { cbindgen::Builder::new() .with_crate(val) .with_language(C) .generate() .expect("Unable to generate bindings") .write_to_file("include/exa_native.h"); } Err(err) => { println!("Error: {}", err); } }
} Whenever we have a non-mangeled (has #[no_mangle] attribute), public, exported C function in our lib.rs or declared as a module there, the fuction signature is going to be added to glue/ios/include/exa_native.h on save. Create glue/ios/include/module.modulemap and add the proper info to export the headers module Exa { header "exa_native.h" export *
}

