FFI stands for foriegn function interface, we will add helpers for converting to and from C types Create glue/ios/src/ffi_helpers.rs use crate::prelude::*;
use libc::c_char;
use std::ffi::{CStr, CString};
pub unsafe fn to_rust_str<'a>(raw_ptr: *const c_char) -> Result<&'a str> { match CStr::from_ptr(raw_ptr).to_str() { Ok(res) => Ok(res), Err(_) => Err(Error::InvalidUtf8), }
}
pub fn to_c_str(s: &str) -> Result<*mut i8> { match CString::new(s) { Ok(string) => Ok(string.into_raw()), Err(_) => Err(Error::InvalidUint), }
} And finally import ffi_helpers.rs inside lib.rs mod error;
